import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const status = ["Pending"];

const currencies = ["US Dollar", "Pound", "Euro", "Aussie Dollar", "Yen", "Rubi", "Yuan", "Swiss Franc"]

function CreateTransaction()
{
    const [accountNumber, setAccountNumber] = useState("");
    const [selectedCurrency, setSelectedCurrency] = useState(currencies[0]);
    const [swiftCode, setSwiftCode] = useState("");
    const [amount, setAmount] = useState("");
    const [receiverAccountNumber, setReceiverAccountNumber] = useState("");
    const [receiverSwiftCode, setReceiverSwiftCode] = useState("");
    const [transactionStatus, setTransactionStatus] = useState("Pending");
    const [error, setError] = useState("")
    const navigate = useNavigate();

    const handleSubmit = async (e) => 
    {
        e.preventDefault();

        try
        {
            // const token = localStorage.getItem("token");
            // await axios.post("/api", 
            // {
            //     accountNumber,
            //     swiftCode,
            //     amount,
            //     currency: selectedCurrency,
            //     receiverAccountNumber,
            //     receiverSwiftCode,
            //     transactionStatus
            // }, {
            //     headers:{
            //         Authorization: `Bearer ${token}`
            //     }
            // });
            // setAccountNumber("");
            // setAmount("");
            // setCurrency("");
            // setReceiverAccountNumber("");
            // setReceiverSwiftCode("");
            // setError("");
            navigate("/ctransaction")
        }
        catch(error)
        {
            setError("Transaction failed: " +error);
        }
    }

    return(
        <>
        <div>
            <h1>New Transaction</h1>
            {error && <p style={{color: 'red'}}> {error} </p>}
            <form onSubmit={handleSubmit}>
                <label htmlFor='AccNumber'>Account Number</label><br/>
                <input type="text" id='AccNumber' name="AccNumber" value={accountNumber} onChange={(e) => setAccountNumber(e.target.value)} /><br/>

                <label htmlFor='swiftCode'>Swift Code/BIC Number</label><br/>
                <input type="text" id='swiftCode' name="swiftCode" value={swiftCode} onChange={(e) => setSwiftCode(e.target.value)} /><br/>

                <label htmlFor='amount'>Amount</label><br/>
                <input type="text" id='amount' name="amount" value={amount} onChange={(e) => setAmount(e.target.value)} /><br/>
                
                <div>
                    <label htmlFor='currency'>Currency</label><br/>
                    {/* <input type="text" id='currency' name="currency" value={currency} onChange={(e) => setSelectedCurrency(e.target.value)} /><br/> */}
                    <select value={selectedCurrency} onChange={e => setSelectedCurrency(e.target.value)}>
                        {currencies.map(currency => <option key={currency} value={currency}>
                            {currency}
                        </option>)}
                    </select>
                </div>

                <label htmlFor='receiverAccountNumber'>Receiver Account Number</label><br/>
                <input type="text" id='receiverAccountNumber' name="receiverAccountNumber" value={receiverAccountNumber} onChange={(e) => setReceiverAccountNumber(e.target.value)} /><br/>

                <label htmlFor='receiverSwiftCode'>Receiver Swift Code</label><br/>
                <input type="text" id='receiverSwiftCode' name="receiverSwiftCode" value={receiverSwiftCode} onChange={(e) => setReceiverSwiftCode(e.target.value)} /><br/>
                
                <button type="submit">Pay Now</button>

            </form>
        </div>
        </>
    );
}

export default CreateTransaction;
